var myApp = angular.module("myApp", []);

myApp.controller("myController", function ($scope) {
    vm = this;
    vm.backgroundImage = "data:image/octet-stream;base64,";
});

myApp.directive("annotation", function () {
    return {
        restrict: 'E',
        scope: {
            backgroundImage: '@'
        },
        templateUrl: "./annotation.html",
        link: function ($scope) {
            $scope.penColors = ['#1a1aff', '#ff0000', '#00cc00', '#ffcc00', '#00ccff'];
            $scope.selectedColor = '#1a1aff';
            $scope.backGroundStyle = {
                "background-image": "url(" + $scope.backgroundImage + ")",
                "background-repeat": "no-repeat"
            };

            $scope.changeColor = function (color) {
                $scope.selectedColor = color;
            }
            $scope.enableDraw = function () {
                $scope.mode = 'draw';
            }
            $scope.enableEraser = function () {
                    $scope.mode = 'erase';
            }
            $scope.enableStickyNote = function () {
                    $scope.mode = 'stickyNote';
            }

            var triggerDownload = function (imgURI) {
                var evt = new MouseEvent('click', { view: window, bubbles: false, cancelable: true });
                var a = document.createElement('a');
                a.setAttribute('download', 'download.png');
                a.setAttribute('href', imgURI);
                a.setAttribute('target', '_blank');
                a.dispatchEvent(evt);
            }

            $scope.captureScreen = function () {
                $scope.capturingInProgress = true;
                html2canvas(document.querySelector("body")).then(canvas => {
                    var imgURI = canvas.toDataURL('image/png');
                    triggerDownload(imgURI);
                    $scope.capturingInProgress = false;
                    $scope.$applyAsync();
                });
            }
        }
    }
});

myApp.directive("drawContainer", function () {
    return {
        restrict: 'E',
        templateUrl: "./draw-container.html",
        link: function ($scope, element) {
            var canvas = element.find('canvas')[0];
            canvas.width = window.innerWidth;
            canvas.height = window.innerHeight;
            var ctx = canvas.getContext('2d');
            ctx.lineJoin = "round";
            var last_mousex = last_mousey = 0;
            var mousex = mousey = 0;
            var mousedown = false;
            var canvasContainer = element.children();
            canvasContainer.bind('mousedown', function () {
                mousedown = true;
            })
            canvasContainer.bind('mousemove', function (e) {
                console.log($scope.selectedColor);
                if ($scope.mode == 'draw' || $scope.mode == 'erase') {
                    mousex = parseInt(e.pageX);
                    mousey = parseInt(e.pageY);
                    if (mousedown) {
                        ctx.beginPath();
                        if ($scope.mode == 'draw') {
                            // line draw
                            ctx.globalCompositeOperation = 'source-over';
                            ctx.strokeStyle = $scope.selectedColor;
                            ctx.lineWidth = 5;
                        } else if ($scope.mode == 'erase') {
                            // line eraser
                            ctx.globalCompositeOperation = 'destination-out';
                            ctx.lineWidth = 10;
                        }
                        ctx.moveTo(last_mousex, last_mousey);
                        ctx.lineTo(mousex, mousey);
                        ctx.lineJoin = ctx.lineCap = 'round';
                        ctx.stroke();
                    }
                    last_mousex = mousex;
                    last_mousey = mousey;
                }
            })
            canvasContainer.bind('mouseup', function () {
                mousedown = false;
                ctx.closePath();
            })
        }
    }
});

myApp.directive("stickyNote", function () {
    return {
        templateUrl: "./sticky-note.html",
        link: function stickyNoteFunction($scope, elem) {
            $scope.sticks = [];
            $scope.newStick = function (event) {
                if ($scope.mode == 'stickyNote') {
                    let stick = {
                        "content": "Write here",
                        "x1": event.clientX,
                        "y1": event.clientY,
                        "x2": event.clientX,
                        "y2": event.clientY,
                        "width": "100%"
                    }
                    $scope.sticks.push(stick);
                    angular.element(document).ready(function () {
                        var id = "myCanvasLine" + ($scope.sticks.length - 1).toString();
                        var c = document.getElementById(id);
                        c.width = window.innerWidth;
                        c.height = window.innerHeight;
                        var ctx2 = c.getContext("2d");
                        ctx2.beginPath();
                        ctx2.moveTo(stick.x1, stick.y1);
                        ctx2.lineTo(stick.x2, stick.y1);
                        ctx2.stroke();
                        $scope.appayDrag();
                    });
                    $scope.mode = 'none';
                }

            }
            // stick dragging
            $scope.appayDrag = function () {
                $('.stick_note_container .sticky-note')
                    .draggable({
                        handle: '.handle',
                        drag: function () {
                            var offset = $(this).offset();
                            var xPos = offset.left;
                            var yPos = offset.top;
                            var myID = $(this).attr('id');
                            $scope.sticks[myID].x2 = xPos + 100;
                            $scope.sticks[myID].y2 = yPos + 100;
                            var c = document.getElementById("myCanvasLine" + myID);
                            c.width = window.innerWidth;
                            c.height = window.innerHeight;
                            var ctx2 = c.getContext("2d");
                            ctx2.beginPath();
                            ctx2.moveTo($scope.sticks[myID].x1, $scope.sticks[myID].y1);
                            ctx2.lineTo($scope.sticks[myID].x2, $scope.sticks[myID].y2);
                            ctx2.stroke();
                        }
                    })
                    .end()
            }
            // remove stick
            $scope.removeStick = function (event, index) {
                $scope.sticks.splice(index, 1);
                event.stopPropagation();
            }
            $scope.stopProp = function (event, index) {
                event.stopPropagation();
            }
        }
    }
});







